  `is_sendhoujuan` int(1) NOT NULL DEFAULT '0' COMMENT '是否下单后赠送代金券 默认0关闭',
  UNIQUE KEY `shopid` (`shopid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8");
